import React, { Component } from 'react';
import { Container } from './styled'
import 'semantic-ui-css/semantic.min.css'
import { Card, Icon } from 'semantic-ui-react'

const extra = (
  <a>
    <Icon name='user' />
    16 Friends
  </a>
)

class CrudFuncionarios extends Component {


  render() {
    return (
      <Container>
        <div className="grid">
          <Card
            image='https://images.pexels.com/photos/236750/pexels-photo-236750.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260'
            header='Elliot Baker'
            meta='Friend'
            description='Elliot is a sound engineer living in Nashville who enjoys playing guitar and hanging with his cat.'
            extra={extra}
          />


        </div>
      </Container>
    );
  }
}

export default CrudFuncionarios;
